import React from 'react';
import ReactDOM from 'react-dom';

class Hi extends React.Component {
  render() {
    return (
      <div>
        <p>Hello {this.props.name}</p>
      </div>
    )
  }
}

const Hello = (props) => {
  return (
    <div>
      <p>Hello {props.name}</p>
    </div>
  )
}

const App = () => {
  return (
    <div>
      <h1>Greetings</h1>
      <Hello name="Damilola"/>
      <Hello name="Jumoke"/>
      <Hello name="Seyi"/>
      <Hi name="Tolani"/>
      <Hi name="Demilade"/>
    </div>
  )
}

ReactDOM.render(<App />, document.getElementById('root'));
